import React from "react";
import Items from "./Items";
import "./App.css"

function App() {
  var mor_items = [
        "Ayoub Zahri",
        "Amal Zahri",
        "Anas Zahri",
        "Achraf Zahri",
        "Aya Zahri"
      ] 
  const denamique = mor_items.map(e=><Items items={e}/> ) 
  return (
    <div className="App"> 
    <Items items="Reda Eskouni" /> 
       <Items items="Kamal Toumi" /> 

       {denamique}
    </div>
  );
}

export default App;
